import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <div className="header">
      <input
        type="text"
        placeholder="Buscar..."
        className="search-bar"
      />
      <div className="user-info">
        <span>Francisco Hernandez</span>
        <span>UNP, Managua</span>
      </div>
    </div>
  );
};

export default Header;
